--
CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_get_resume` (IN `MODE` INT, IN `p_id` BIGINT)   BEGIN
	IF MODE = 1
    THEN
    	BEGIN 
    		SELECT  resume_content
            FROM 	tbl_resume_analyses
            WHERE 	id = p_id
            ORDER BY created_at DESC
            LIMIT 1; 
		END;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_insert_resume` (IN `MODE` INT, IN `p_resume_content` LONGTEXT, IN `p_job_description` TEXT)   BEGIN
	IF MODE = 1
    THEN
    	BEGIN 
    		INSERT INTO tbl_resume_analyses (resume_content
        	                             	,job_description)
    		VALUES 							(p_resume_content
            	                         	,p_job_description);
		END;
        SELECT LAST_INSERT_ID() AS inserted_id;
    END IF;
END$$

DELIMITER ;

