\r\n.Quote Char {color: #404040; font-style: italic;}\r\n.List Paragraph {margin-left: 0.5in; margin-right: 0in;}\r\n.Intense Emphasis {color: #2F5496; font-style: italic;}\r\n.Intense Quote {color: #2F5496; font-style: italic;}\r\n.Intense Quote Char {color: #2F5496; font-style: italic;}\r\n.Intense Reference {color: #2F5496; font-weight: bold; font-variant: small-caps;}\r\n.Normal (Web) {font-family: \'Times New Roman\'; font-size: 12pt;}\r\nbody > div + div {page-break-before: always;}\r\ndiv > *:first-child {page-break-before: auto;}\r\n@page page1 {size: A4 portrait; margin-right: 1in; margin-left: 1in; margin-top: 1in; margin-bottom: 1in; }\r\n</style>\r\n</head>\r\n<body>\r\n<div style=\'page: page1\'>\r\n<p style=\"text-align: center;\"><span style=\"font-family: \'Times New Roman\'; font-size: 16pt; font-weight: bold;\">CHATBOT USING DIALOGFLOW API</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">INTRODUCTION</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\">	<span style=\"font-family: \'Times New Roman\';\">The project aims to produce and deliver an AI-driven conversational app and experience to its user. By integrating Flutter, for its capability of cross-platform integration of the UI, and </span><span style=\"font-family: \'Times New Roman\';\">DialogFlow</span><span style=\"font-family: \'Times New Roman\';\"> for NLP (Natural Language Processing). The application provides a critical solution for automated customer support and personal assistance with its scalability for bigger purposes on the future.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">STAKEHOLDER IDENTIFICATION</span></p>\r\n\r\n<p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Symbol\';\"></span>  <span style=\"font-weight: bold;\">Users</span><span style=\"font-weight: bold;\">:</span> End-users seeking instant information or task automation.</p>\r\n<p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Symbol\';\"></span>  <span style=\"font-weight: bold;\">Product</span><span style=\"font-weight: bold;\"> Owners:</span> Responsible for the conversational flow and intent accuracy.</p>\r\n<p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Symbol\';\"></span>  <span style=\"font-weight: bold;\">Developers</span><span style=\"font-weight: bold;\">:</span> Responsible for Flutter UI, API integration, and backend logic.</p>\r\n<p style=\"text-align: justify; margin-top: 0pt; margin-bottom: 0pt; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Symbol\';\"></span>  <span style=\"font-weight: bold;\">Google</span><span style=\"font-weight: bold;\"> Cloud (</span><span style=\"font-weight: bold;\">Dialogflow</span><span style=\"font-weight: bold;\">):</span> The service provider for NLP and machine learning infrastructure.</p>\r\n<p><span style=\"font-weight: bold;\">METHODOLOGY</span></p>\r\n\r\n<p style=\"text-align: justify; margin-top: 0pt; margin-left: 0in; margin-right: 0in;\">For the project, the developers used Evolutionary Prototyping. This allowed building of the Flutter interface first and iteratively design and fix the Dialogflow &quot;Intents&quot; based on how the bot responded during testing.</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">DETAILED REQUIREMENTS</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Functional Requirements</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Intent Recognition:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> The app must correctly identify user intent.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Message History:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> The UI must display a </span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">user-friendly conversational interface that is straightforward and easy to use</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Real-time Response:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> The app must fetch responses from the </span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">Dialogflow</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> API without refreshing the screen.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Authentication</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">: Secure communication between the Flutter app and Google Cloud via JSON Service Account keys.</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Non-Functional Requirements</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Performance:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> API response time should be under 1.5 seconds.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Usability:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> The interface must follow Material Design principles for intuitive navigation.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Platform Compatibility:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> The code must run seamlessly</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> on various devices</span></p>\r\n\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">DATA FLOW DIAGRAM (DFD)</span></p>\r\n\r\n<p style=\"text-align: justify;\"><img border=\"0\" style=\"width: 1360px; height: 784px;\" src=\"data:image/png;base64,\"/></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">PRIORITIZATION OF REQUIREMENTS </span></p>\r\n\r\n<p style=\"text-align: justify;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Requires:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">Dialog</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">F</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">low</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> API connection, Text-input field, Message bubbles.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\';\">Loading indicators (spinners) while the bot &quot;thinks.&quot;</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Possible </span><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Additions</span><span style=\"font-family: \'Times New Roman\';\">:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">Voice-to-text integration for hands-free chatting.</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Not Included: </span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">Offline mode (the app requires an active internet connection for the API).</span></p>\r\n\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">CONSTRAINTS AND ASSUMPTIONS</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Assumptions:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">User has stable internet connection when using the application.</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.5in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Constraint:</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\">DialogFlow</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\';\"> free tier used has limitation on requests.</span></p>\r\n\r\n<p><span style=\"font-family: \'Times New Roman\';\">Service account keys must and are kept secure out of public’s eyes.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">ACCEPTANCE CRITERIA</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">The acceptance criteria for the chatbot focus</span><span style=\"font-family: \'Times New Roman\';\">es</span><span style=\"font-family: \'Times New Roman\';\"> on seamless integration and reliable user interaction. First, the system&#039;s connectivity is validated by the successful initialization of the </span><span style=\"font-family: \'Times New Roman\';\">DialogFlowtter</span><span style=\"font-family: \'Times New Roman\';\"> package using the provided JSON asset. To ensure accuracy in conversation, the bot must consistently trigger the &quot;Default Fallback Intent&quot; whenever it encounters an unrecognized query. From a usability perspective, the UI is required to be responsive, specifically ensuring that the mobile keyboard does not overlap or obscure the most recent messages. Finally, robust state management is confirmed when the </span><span style=\"font-family: \'Times New Roman\';\">setState</span><span style=\"font-family: \'Times New Roman\';\">(</span><span style=\"font-family: \'Times New Roman\';\">) method correctly triggers a real-time rebuild of the message list as soon as a response is received from the API.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">APPEND</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">IC</span></p>\r\n<p><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">ES</span></p>\r\n\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Definition of Terms:</span></p>\r\n<table style=\"table-layout: auto;\">\r\n<tr>\r\n<th style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Term</span></p>\r\n</th>\r\n<th style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Definition</span></p>\r\n</th>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">API</span></p>\r\n</td>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">Application Programming Interface; the bridge between Flutter and </span><span style=\"font-family: \'Times New Roman\';\">Dialogflow</span><span style=\"font-family: \'Times New Roman\';\">.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Dialogflow</span></p>\r\n</td>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">Google’s Natural Language Understanding (NLU) platform used to design the chat logic.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Intent</span></p>\r\n</td>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">A specific goal or category of a user&#039;s input (e.g., a &quot;Greeting&quot;).</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Fallback</span></p>\r\n</td>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">The default response triggered when the bot does not recognize the user&#039;s input.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">JSON</span></p>\r\n</td>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">JavaScript Object </span><span style=\"font-family: \'Times New Roman\';\">Notation;</span><span style=\"font-family: \'Times New Roman\';\"> the format used for the Service Account key and API data exchange.</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Widget</span></p>\r\n</td>\r\n<td style=\"vertical-align: center; border-top-style: solid; border-top-color: auto; border-top-width: 0.3pt; border-left-style: solid; border-left-color: auto; border-left-width: 0.3pt; border-bottom-style: solid; border-bottom-color: auto; border-bottom-width: 0.3pt; border-right-style: solid; border-right-color: auto; border-right-width: 0.3pt;\">\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\';\">The basic building block of the Flutter UI (e.g., buttons, text fields).</span></p>\r\n</td>\r\n</tr>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Dependencies</span><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">:</span></p>\r\n<p style=\"text-align: justify; margin-left: 0.25in; margin-right: 0in;\"><img border=\"0\" style=\"width: 525px; height: 156px;\" src=\"data:image/png;base64,\"/></p>\r\n<p style=\"margin-left: 0.25in; margin-right: 0in;\"><span style=\"font-family: \'Times New Roman\'; font-weight: bold;\">Service Account JSON Template:</span></p>\r\n<p style=\"margin-left: 0.25in; margin-right: 0in;\"><br />\r\n<img border=\"0\" style=\"width: 882px; height: 229px;\" src=\"data:image/png;base64,\"/></p>\r\n</div>\r\n</body>\r\n</html>\r\n', 'sadadadadadas', '2026-02-05 20:18:20');

